import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from './components/Dialogs/Dialogs'
import { Route } from 'react-router-dom';
import {BrowserRouter} from 'react-router-dom';
import MyCalendar from './components/MyCalendar/MyCalendar';
import Watchlist from './components/Watchlist/Watchlist'
const App = () => {

  let postData = [
    { id: 1, post: 'Hi, how are you?', likeCount: 5 },
    { id: 2, post: "It's my first post", likeCount: 8 },
    { id: 3, post: 'you are good' },
    { id: 4, message: 'yo' },
    { id: 5, message: 'you' }
  ]
  return (
    <BrowserRouter>
    <div className= 'app-wrapper'>
      <Header />
      <Navbar />
      {/* <Profile />     */}
      <div class='app-wraper-content'>
        {/* <Route path='/Dialogs' component={Dialogs} />
        <Route path='/Profile' component={Profile} />
        <Route path='/Watchlist' component={Watchlist} />
        <Route path='/MyCalendar' component={MyCalendar} /> */}
        <Route path='/Dialogs' render={ () => <Dialogs />} />
        <Route path='/Profile' render={ () => <Profile />} />
        <Route path='/Watchlist' render={ () => <Watchlist />} />
        <Route path='/MyCalendar' render={ () => <MyCalendar />} />
      {/* <Massage /> */}
      </div>
    </div>
    </BrowserRouter>
  );
}



export default App;
